body.div:
			446.—451. τῷ δουλόσυνος: τίνι δούλη ὀνομασθεῖσα πρὸς τὸν οἷκον ἀφίξομαι;
                            M. πρὸς τίνος οἰκον δούλη κτηθεῖσα ἀφίξομαι; ἢ πορεύσεις με ἀπὸ κοινοῦ
                            πρὸς τὸν ὅρμον τῆς Δωρίδος, ἢ εἰς τὸν ὅρμον

			1283. ἀλγεῖς: πονεῖς ἀκούων. Ι. οὐκ ἐφέξετε: οὐ καθέξετε τὸ στόμα αὐτοῦ;
                            B.I. ἐφέξετε: ἐγκλείσετε. Gr. κρατήσετε. Gu. ἐπέχω τὸ κρατῶ, ὡς τὸ
                            “ἐπεῖχον τὴν γλῶσσαν.” Fl. 59.
